import React from 'react';
import './Sidebar.css';

function Sidebar() {
  return (
    <aside className="sidebar">
      <div className="user-info">
        <h2>Mr. S. Sahan</h2>
        <p>Field Officer</p>
      </div>
      <ul className="menu">
        <li>Work Program</li>
        <li className="active">Morning Muster</li>
        <li>Evening Muster</li>
        <li>Work Distribution</li>
        <li>Fertilizer Application</li>
        <li>Cost</li>
        <li>Crop Achievement</li>
        <li>Order Request / Return</li>
        <li>Leave Application</li>
        <li>Correspondence</li>
      </ul>
    </aside>
  );
}

export default Sidebar;
